import { Button } from "@mui/material";
import "./form.css";
const Form = () => {
  return (
    <div className="form-div">
      <form className="form">
        <input className="input" type="text"></input>

        <input className="input input-date" type="date"></input>
        <Button className="btn" variant="contained" size="large">
          {" "}
          Add Item
        </Button>
      </form>
    </div>
  );
};

export default Form;
